import React, { Component } from 'react';
import './settings.css';

export default class componentName extends Component {
  render() {
    return (
      <div>
        <div className='energy-usage-control'>
        <form className='temperature-form'>
            <label htmlFor="temperature">Set Temperature: </label>
            <input type="text" id="temperature" name="temperature" placeholder="Enter New Temperature.."/>
            <input type="submit" id="submit" value="Submit"/>
        </form>

        </div>
      </div>
    )
  }
}
